post_text:
On Saturday, December 7, the following tiger Band members auditioned for the Region 18/26 ATSSB bands.
Brooke DeAngelis, alto saxophone, 6th chair concert band, Area qualifier;
Kennedy Yanez, flute;
Aidan Parker, tuba, 7th chair symphonic band, Area qualifier;
Billy Joe Renfro, euphonium, 5th chair concert band;
Luke Marx, percussion, 1st chair symphonic band, Area qualifier;
Max Finn, alto saxophone, 6th chair concert band, Area qualifier; and
Roy Finn, tenor saxophone, 2nd chair symphonic band, Area qualifier.

Area qualifiers will be auditioning for a place in the ATSSB All-State Bands at Robinson HS on Saturday, January 11. Those placing in the Region Bands will be participating in the clinic and concert performance at the Jerry Wilhelm Center for Performing Arts in Bastrop January 31-February 1.

Congratulations to all of these Thrall Tiger Band members!

